import React from 'react'

import './App.css';

import {Box, Button,} from '@mui/material'

const buttonStyle = {
  backgroundColor: "grey",
}

const App = () => {
  const [value, setValue] = React.useState();
  const onChangeValue = React.useCallback((event) => {
    setValue(event.target.value)
  }, [])

  React.useEffect(() => console.log(value), [value])
  return (
    <div className="App">
      <Box display="grid" gridTemplateRows="auto auto" justifyContent="center" alignItems="center"  mt={10}>
        <>
        <Box display="flex" mr={1}>
          <Button variant="contained" style={buttonStyle}>
          use SHA256
          </Button>
        </Box>
        <Box display="flex" ml={1}>
          <Button variant="contained" style={buttonStyle}>
          use STREEBOG
          </Button>
        </Box>
        </>
        <input value={value} onChange={onChangeValue}></input>
      </Box>
    </div>
  );
}

export default App;
